import React, { useState } from 'react'
import Menu from '@material-ui/core/Menu';
import MenuItem from '@material-ui/core/MenuItem';
import Avatar from '@material-ui/core/Avatar';
import SimpleModal from './SimpleModel'
import LoginForm from './LoginForm'
const AvatarMenu = () => {
    const [openMenu, setOpenMenu] = useState();
    const [openModal, setOpenModal] = useState(false);

    const handleClick = (e) => {
        setOpenMenu(e.currentTarget)
    }

    const handleClose = () => {
        setOpenMenu(false)
    }

    const handleSeleciton = (e) => {
        console.log(e)
    }

    const body = (
        <LoginForm />
    )
    return (
        <div>
            <SimpleModal openModal={openModal} setOpenModal={setOpenModal} title={"Login"} desc={body} onClick={handleClose} buttonText={"Cancel"} />
            <Avatar aria-controls="simple-menu" aria-haspopup="true" onClick={handleClick} />
            <Menu
                id="simple-menu"
                anchorEl={openMenu}
                keepMounted
                open={Boolean(openMenu)}
                onClose={handleClose}
            >
                {/* <MenuItem onClick={handleClose}>Profile</MenuItem>
                <MenuItem onClick={handleClose}>Previous Games</MenuItem> */}

                <MenuItem onClick={() => handleSeleciton("login")}>Login</MenuItem>
            </Menu>
        </div>
    )
}

export default AvatarMenu
